import "./App.css";
import BranchForm from "./BranchForm";
import FormSubmitted from "./FormSubmitted";
import Main from "./Main";
import { Routes, Route } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route path="/" element={<Main />}>
        <Route element={<BranchForm />} />
      </Route>
      {/* </Route> */}
    </Routes>
  );
}

export default App;
